script: |
  super -f text -I q4129.spq | sort > q4129.out

inputs:
  - name: q4129.spq
    data: |
      SELECT DISTINCT + col0 + col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN + 63 / + col0 + col0 * + 82 AND col1 * - col1 + - col2;
  - name: tab2

outputs:
  - name: q4129.out
    data: |
